export default function filterExpandNode(current, next) {
    var cExpandNode = current.expandNode;
    var rootInfoMap = next.rootInfoMap, nExpandNode = next.expandNode;
    cExpandNode.forEach(function (rootId) {
        if (nExpandNode.indexOf(rootId) === -1 && rootInfoMap[rootId]) {
            nExpandNode.push(rootId);
        }
    });
    return nExpandNode;
}
